import { useState } from 'react';
import './App.css';
import "./Responsive.css"
import HomePage from './Pages/HomePage/HomePage';
import {Route, Routes } from 'react-router-dom';
import ResetPassword from './ResetPassowrd/ResetPassowrd';
import Dashboard from './Pages/Dashboard/Dashboard';
function App() {
  const [setText] = useState('Initial text');

  return (
    <div className="App">
      <Routes>
      <Route path='/' element={<HomePage/>} />
      <Route path='/Dashboard' element={<Dashboard setText={setText} />} />
      <Route path='/ResetPassword' element={<ResetPassword setText={setText} />} />
      </Routes>
    </div>
  );
}

export default App;
